import React, { Component } from "react";

class General extends Component {
    constructor() {
        super();
        this.state = {
            info: {
                firstName: '',
                lastName: '',
                address: '',
                phoneNumber: '',
                email: '',
                description: '',
            }
        }
    }

    infoChange = (e) => {
        e.preventDefault();
        this.setState({
            info: {
                firstName: e.target.value,
            }
        })
    }

    render() {
        return (
            <div className="generalInformation">
                <h1> Personal Information </h1>
                <input onChange={infoChange} className="info" type="text" placeholder="First Name" id="first-name" value={info.firstName}/>
                <input onChange={infoChange} className="info" type="text" placeholder="Last Name" id="last-name" value={info.lastName}/>
                <input onChange={infoChange} className="info" type="text" placeholder="Address" id="address" value={info.address}/>
                <input onChange={infoChange} className="info" type="text" placeholder="Phone Number" id="phone-number" value={info.phoneNumber}/>
                <input onChange={infoChange} className="info" type="text" placeholder="Email" id="email" value={info.email}/>
                <input onChange={infoChange} className="info" type="text" placeholder="Description" id="description" value={info.description}/>
                <button></button>
            </div>
        )
    }

}

export default General;
